	private static int step = 10;
	private static int interval = 50; // 2 sec
	
	private Song getSongForRecord(float[][] record, int startIndex, int stopIndex) {
		SimpleDanceRecord sdr = new SimpleDanceRecord();
		sdr.setQueue(Arrays.copyOfRange(record[0], startIndex, stopIndex), 
				Arrays.copyOfRange(record[1], startIndex, stopIndex),
				Arrays.copyOfRange(record[2], startIndex, stopIndex));
		Song song = sdr.isSong();
		System.out.println("\nstats:" + sdr.getStats() + "\n");
		return song;
	}
	
	@Test
	public void test_gs_a_presong() {
		float[][] record = {gs_zs_a, gs_xs_a, gs_ys_a};
		int startIndex = 0;
		int stopIndex = 21;
		System.out.println("getting song for record a presong");
		Song song = getSongForRecord(record, startIndex, stopIndex);	
		assertEquals(Song.NONE, song);
	}
	
	@Test
	public void test_gs_a_song() {
		float[][] record = {gs_zs_a, gs_xs_a, gs_ys_a};
		int startIndex = 21;
		int stopIndex = 150;
		for (int i = startIndex; i <= stopIndex - interval; i += step) {
			System.out.println("getting song for record a. start index: " + i + ", length: " + interval);
			Song song = getSongForRecord(record, i, i + interval);			
			assertEquals(Song.GANGNAM_STYLE, song);
		}
	}

